var jq = jQuery.noConflict();
jq(document).ready(function () {
	jq('.ir-province').each(loadProvinces);
	jq('.ir-province').change(loadCities);
});

var loadProvinces = function () {
	var element = jq(this);
	element.empty();
	element.append(jq('<option>لطفا استان خود را انتخاب نمایید</option>').attr('value', 'empty'));
	jq.each(data, function (province, list) {
		var option = jq('<option></option>').attr('value', province).text(province);
		element.append(option);
	});
};

var loadCities = function () {
	var citySelector = jq(this).closest('.ir-select').find('.ir-city');
	var selectedProvince = jq(this).val();
	var cityList = data[selectedProvince];

	citySelector.empty();

	jq.each(cityList, function (index, city) {
		var option = jq('<option>شهر</option>').attr('value', city).text(city);
		citySelector.append(option);
	});
};

